from EXE.exe_info import WACOM_PAGE_URLS, XP_PEN_PAGES_URLfrom EXE.exe_model import ExeStoredef start_exe_wacom():    exe = ExeStore(urls=WACOM_PAGE_URLS)    items = exe.generate_info_wacom()    return exe.compare_data(items)def start_exe_xp_pen():    exe = ExeStore(urls=XP_PEN_PAGES_URL)    items = exe.generate_info_wacom()    return exe.compare_data_xp_pen(items)